pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "../libs/Shared.sol";

import "../Juice.sol";
import "../Consortium.sol";

import "./Publishers.sol";
import "./INetwork.sol";

contract Assets {

    // When asset issued
    event Issued(bytes32 indexed id, address network);

    /**
    *   Asset Model
    *   -active: Asset is enabled for trading
    *   -root: Root assets are parents of NFA's

    *   -quantity: Total amount of issued of this asset
    *   -nfaLimit: Total allowed amount of nfa's to be issued
    *   -nftQuantity: Total amount of nfa's issued
    *
    *   -created: timestamp issued (block-time)
    *   -network: network the asset was allocated to
    */
    struct Asset {
        bool active;
        bool root;

        uint256 quantity;
        uint256 nfaLimit;
        uint256 nfaQuantity;

        uint256 created;

        address network;
    }

    // Juice contract reference
    Juice internal juice;

    // Publishers contract reference
    Publishers internal publishers;

    // Consortium contract reference
    Consortium internal consortium;

    constructor(address juiceAddress, address publisherAddress, address consortiumAddress) public {
        juice = Juice(juiceAddress);
        consortium = Consortium(consortiumAddress);
        publishers = Publishers(publisherAddress);
    }

    /**
     * Array with all assets
     */
    mapping(bytes32 => Asset) public assets;
    uint256 assetCounter;


    // ----------------------------------------------------------------------------------------------------------
    // ----------------------------------------------- MODIFIERS ------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------


    /**
      *  Verify Asset exists, and sender is owner
      *  additionally require the asset to be active.
      *
      *  active: true when assets needs to be active to proceed
      */
    modifier isOwnerAndExists(bytes32 id, bool active) {

        // verify asset exists
        require(exists(id) == true, "Unknown asset");

        // verify publisher is calling
        bytes8 publisher = Shared.extractPublisher(id);
        require(publishers.isOwner(publisher, msg.sender), "Only publisher is allowed to modify");

        // check (optional) if asset was disabled
        if (active)
            require(assets[id].active == true, "Asset disabled, modifications not allowed");

        _;
    }

    /**
     *  Check if user is allowed publisher for issuing the asset
     */
    modifier _isValidIssuer(bytes32 assetId, address sender){
        bytes8 publisher = Shared.extractPublisher(assetId);
        require(publishers.isAvailable(publisher) == true, "Publisher is inactive");
        require(publishers.isOwner(publisher, sender), "Only Publisher can issue assets");
        _;
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ INTERNAL ------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    function storeAsset(bytes32 id, bool root, uint256 quantity, address network) internal returns (bytes32) {

        Asset memory a;
        a.root = root;
        a.active = true;
        a.created = block.timestamp;
        a.network = network;

        a.quantity = quantity;

        if (root){
            a.quantity = 1;
            a.nfaLimit = quantity;
            a.nfaQuantity = 0;
        }

        assets[id] = a;
        assetCounter++;

        return id;
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------- PUBLIC -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------


    /**
     *  Issue new asset
     */
    function issue(bytes32 id, bool root, uint256 quantity, address network)
        public _isValidIssuer(id, msg.sender) returns (bool) {

        // Check quantity
        require(quantity > 0, "Minimum quantity is 1");

        // if root then only uint32 allowed as anount
        if (root)
            require(quantity < 4294967295, "Root assets can only have 4294967295 maximum children");

        // check if not exists
        require(exists(id) == false, "Asset already issued");

        storeAsset(id, root, quantity, network);

        // deposit new asset into account
        bool result = INetwork(network).allocate(id, msg.sender, root ? 1 : quantity);

        if (result){
            // charge publisher the fee
            juice.charge(msg.sender, consortium.issueFee());
            emit Issued(id, network);
            return true;
        }

        return false;
    }


    /**
     *  Issue and transfer nfa
     */
    function issueNFA(bytes32 assetId, address receiver)
        public _isValidIssuer(assetId,msg.sender) returns (bool) {

        // extract master-assets id
        bytes32 rootAssetId = Shared.extractRootId(assetId);
        require(isRoot(rootAssetId), "Invalid or none root asset provided");

        // Check if asset is existing
        require(exists(assetId) == false, "Asset already issued");

        // load master-asset
        Asset storage rootAsset = assets[rootAssetId];
        rootAsset.nfaQuantity++;   // increase count

        // check if more nfa's can be issued
        require(rootAsset.nfaQuantity <= rootAsset.nfaLimit, "Limit of NFA quantity reached");

        // create nfa
        storeAsset(assetId, false, 1, rootAsset.network);

        // deposit new asset into account
        return INetwork(rootAsset.network).allocate(assetId, receiver, 1);
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ SETTERS -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------


    /**
     * Enable and disable the asset (globally)
     */
    function setActive(bytes32 id, bool active) public payable isOwnerAndExists(id, false) {
        assets[id].active = active;
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ GETTERS -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    /**
     *  Get asset
     */
    function get(bytes32 id) public view returns (Asset memory) {
        return assets[id];
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ HELPERS -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    /*
     *  Check if asset exists
     */
    function exists(bytes32 id) public view returns (bool) {
        return assets[id].created != 0;
    }

    /*
     *  Check if asset is root asset
     */
    function isRoot(bytes32 id) public view returns (bool) {
        return assets[id].root;
    }

    /*
     *  Check if asset exists and is active
     */
    function isActive(bytes32 id) public view returns (bool) {
        if (exists(id))
            if (assets[id].active == true) return true;

        return false;
    }

}
